  display: flex;
  align-items: right;
  justify-content: right;
  flex-wrap: wrap;
  `;

  export default function index() {
    
    let pokemon = {};

    ListPokemon().then( (success) => {
      console.log(success);
    })

    return (
      <GridWrapper>
        <PokemonTile pokemon={pokemon} />
      </GridWrapper>
    );
  }
